Add array values into MongoDB where element is not in array<p>In MongoDB, this is the simplified structure of my <code>account</code> document:</p>

<pre><code>{
    "_id" : ObjectId("5a70a60ca7fbc476caea5e59"),
    "templates" : [ 
        {
            "name" : "Password Reset",
            "content" : "AAAAAAAA"
        },
        {
            "name" : "Welcome Message",
            "content" : "BBBBBB"
        }
     ]
}
</code></pre>

<p>There's a similar <code>default_templates</code> collection</p>

<pre><code>let accnt = await Account.findOne({ _id: req.account._id }, { templates: 1 });
let defaults = await DefaultTemplate.find({}).lean();
</code></pre>

<p>My goal is to find the missing templates under account and grab them from defaults. (a) I need to upsert <code>templates</code> if it doesn't exist in an account and (b) I don't want to update a template if it already exists in an account.</p>

<p>I've tried the following:</p>

<pre><code>if (!accnt.templates || accnt.templates.length &lt; defaults.length) {

  const accountTemplates = _.filter(accnt.templates, 'name');
  const templateNames = _.map(accountTemplates, 'name');

  Account.update({ _id: req.account._id, 'templates.name' : { $nin: templateNames } },
      { '$push': { 'templates': { '$each' : defaults } } }, { 'upsert' : true },
      function(err, result) {
        Logger.error('error %o', err);
        Logger.debug('result %o', result);
      }
  );
}
</code></pre>

<p>This succeeds at the upsert but it will enter all default templates even if there's a matching name in <code>templateNames</code>. I've verified that <code>templateNames</code> array is correct and I've also tried using <code>$addToSet</code> instead of <code>$push</code>, so I must not understand Mongo subdoc queries.</p>

<p>Any ideas on what I'm doing wrong?</p>

<p>Edit: I've gotten this to work by simply removing elements from the defaults array before updating, but I'd still like to know how this could be accomplished with Mongoose.</p>

