How to make lookup between two collections when an item in an array exists in the other collection?<p>In Lookup with a pipeline, I would like to get the linked records from an array in the parent document.</p>

<pre><code>// Orders
[{ 
    "_id" : ObjectId("5b5b91a25c68de2538620689"), 
    "Name" : "Test", 
    "Products" : [
        ObjectId("5b5b919a5c68de2538620688"), 
        ObjectId("5b5b925a5c68de2538621a15")
    ]
}]

// Products
[
{
   "_id": ObjectId("5b5b919a5c68de2538620688"),
   "ProductName": "P1"
},
{
   "_id": ObjectId("5b5b925a5c68de2538621a15"),
   "ProductName": "P2"
}
,
{
   "_id": ObjectId("5b5b925a5c68de2538621a55"),
   "ProductName": "P3"
}
]
</code></pre>

<p>How to make a lookup between Orders and Products when <code>Products</code> field is an <strong>array</strong>!</p>

<p>I tried this query </p>

<pre><code>db.getCollection("Orders").
    aggregate(
    [
    {
     $lookup:
         {
           from: "Products",
           let: { localId: "$_id" , prods: "$Products" },
           pipeline: [
              {
                "$match": 
                {
                    "_id" : { $in: "$$prods"  }
                }
              }, 

              { 
                $project: 
                { 
                  "_id": "$_id", 
                  "name": "$prods" ,
                }
               }
           ],
           as: "linkedData"
         }

    },
    {
        "$skip": 0
    },
    {
        "$limit": 1
    },
    ]
)
</code></pre>

<p>This is not working because <code>$in</code> is expecting an array, and even though <code>$$prods</code> is an array, it is not accepting it.</p>

<p>Is my whole approach correct? How to make this magic join ?</p>

